import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import {Table, Button, Container, Modal, ModalBody, ModalHeader, FormGroup, ModalFooter} from 'reactstrap';

const data = [
  { id: 1, nombres: "Luis Alberto", apellidos: "Anguita Fernández", edad: 34, run: "16.534.406-5"},
  { id: 2, nombres: "Pepe", apellidos: "Rojas", edad: 34, run: "16.666.666-6"}
];
class App extends React.Component {
  state = {
    data: data
  }
  render(){
    return (
    <>
    <br />
    <Container>
    <Button color="success">Crear Nuevo Usuario</Button>
    <br /><br />
    <Table>
      <thead>
          <tr>
              <th>Id</th>
              <th>Nombres</th>
              <th>Apellidos</th>
              <th>Edad</th>
              <th>RUN</th>
              <th>Acciones</th>
          </tr>
      </thead>
      <tbody>
        {this.state.data.map((usuario)=>{
          <tr>
            <td>{usuario.id}</td>
            <td>{usuario.nombres}</td>
            <td>{usuario.apellidos}</td>
            <td>{usuario.edad}</td>
            <td>{usuario.run}</td>
            <td>
              <Button color="primary">Editar</Button> <br />
              <Button color="danger">Eliminar</Button>
            </td>
          </tr>
      })}
      </tbody>
    </Table>
    </Container>
    </>
    )
  }
}

export default App;
